pragma solidity 0.7.4;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/SafeERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/math/SafeMathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/math/MathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/Initializable.sol";
import "./interfaces/IGateway.sol";
import "./interfaces/IPool.sol";
import "./interfaces/INexusDistributor.sol";
import "./interfaces/IQuotationData.sol";
import "./interfaces/IGateway.sol";
import "../../IDistributor.sol";

contract NexusDistributorWrapper is IDistributor,
    OwnableUpgradeable,
    ReentrancyGuardUpgradeable
{

    using MathUpgradeable for uint256;
    using SafeMathUpgradeable for uint256;
    INexusDistributor nexuBrightMasterNft;

    function initialize(
        address _nexuBrightMasterNft
    ) public initializer {
        __Ownable_init();
        __ReentrancyGuard_init();
        nexuBrightMasterNft = INexusDistributor(_nexuBrightMasterNft);
    }


    function getCoverCount(address _owner, bool _) external view override returns (uint256){
        return  nexuBrightMasterNft.balanceOf(_owner);
    }

    function getCover(address _owner, uint256 _coverId, bool _isActive, uint256 _loopLimit) external view override
        returns (IDistributor.Cover memory ){
                     IDistributor.Cover memory cover;
                     if(_isActive == true){
                         cover = this._nexusGetCoversBoughtFromNexusDirectly(_owner, _coverId, _loopLimit);
                     }else{
                         cover = this._nexusGetCoversBoughtFromNexusDistributor(_owner, _coverId, _loopLimit);
                     }
            return cover;
        }

    function _nexusGetCoversBoughtFromNexusDistributor(address _owner,  uint256 _coverId, uint256 _loopLimit) 
        external view returns (Cover memory){

        uint ownerBalance =  nexuBrightMasterNft.balanceOf(_owner);
        uint limit = 0;
        if(ownerBalance > _loopLimit){ limit = _loopLimit;} //TODO: .max() fails
        else{limit = ownerBalance;}

        Cover[] memory covers = new Cover[](ownerBalance);

        for (uint i = 0; i < limit; i++){
            uint256 tokenId =  nexuBrightMasterNft.tokenOfOwnerByIndex(_owner, i);

            Cover memory cover;

            (uint8 status,
            uint256 sumAssured,
            uint16 coverPeriod,
            uint256 validUntil,
            address contractAddress,
            address coverAsset,
            uint256 premiumInNXM,
            address memberAddress) = nexuBrightMasterNft.getCover(tokenId);

            cover.status = status;
            cover.coverAmount = sumAssured;
            cover.productId = coverPeriod;
            cover.expiration = validUntil;
            cover.contractAddress = contractAddress;
            cover.currency = coverAsset;
            cover.premium = premiumInNXM;
            cover.refAddress = memberAddress;
            covers[i] = cover;
        }
        return covers[_coverId];
    }

    function _nexusGetCoversBoughtFromNexusDirectly(address _owner,  uint256 _coverId, uint256 _loopLimit) 
     external view returns (Cover memory){

        uint[] memory userCovers =  this._nexusGetAllCoversOfUser(_owner);
        uint limit = 0;
        if(userCovers.length > _loopLimit){ limit = _loopLimit;} // TODO: .max() fails
        else{ limit = userCovers.length; }


        Cover[] memory covers = new Cover[](userCovers.length);

        for (uint id = 0; id < limit; id++){
                Cover memory cover;
                (uint8 status,
                uint256 sumAssured,
                uint16 coverPeriod,
                uint256 validUntil,
                address contractAddress,
                address coverAsset,
                uint256 premiumInNXM,
                address memberAddress)  = nexuBrightMasterNft.getCover(id);

                cover.status = status;
                cover.coverAmount = sumAssured;
                cover.productId = coverPeriod;
                cover.expiration = validUntil;
                cover.contractAddress = contractAddress;
                cover.currency = coverAsset;
                cover.premium = premiumInNXM;
                cover.refAddress = memberAddress;

                covers[id] = cover;
         }
        return covers[_coverId];
    }

    function _nexusGetAllCoversOfUser(address _add) external view returns (uint[] memory allCover){
        address nexusQuotationDataAddress = nexuBrightMasterNft.getLatestAddress("QD");
        uint[] memory allCover = IQuotationData(nexusQuotationDataAddress).getAllCoversOfUser(_add);
        return allCover;
    }

    function getQuote(
        uint256 _sumAssured,
        uint256 _coverPeriod,
        address _contractAddress,
        address _coverAsset,
        address _nexusCoverable,
        bytes calldata _data
    )public view  override returns(
        IDistributor.CoverQuote memory
    ){
        address nexusGatewayAddress = nexuBrightMasterNft.getLatestAddress("GW");
        IQuotationData quoteData = IQuotationData(nexuBrightMasterNft.getLatestAddress("QD"));

        uint256 coverPrice = IGateway(nexusGatewayAddress).getCoverPrice(
            _contractAddress,
            _coverAsset,
            _sumAssured,
            uint16(_coverPeriod),
            IGateway.CoverType(1),
            _data
        );

        CoverQuote memory coverQuote;
        coverQuote.prop1 = nexuBrightMasterNft.feePercentage();
        coverQuote.prop2 = coverQuote.prop1.mul(coverPrice)
                                            .div(10000)
                                            .add(coverPrice);
        coverQuote.prop3 = quoteData.getCoverLength();
        coverQuote.prop4 = quoteData.getTotalSumAssuredSC(_nexusCoverable,"DAI");
        coverQuote.prop5 = quoteData.getTotalSumAssuredSC(_nexusCoverable, "ETH");
        coverQuote.prop6 = quoteData.getTotalSumAssured("DAI");
        coverQuote.prop7 = quoteData.getTotalSumAssured("ETH");

        return coverQuote;
    }

    function buyCover(
        address contractAddress,
        address coverAsset,
        uint256 sumAssured,
        uint16 coverPeriod,
        uint8 coverType,
        uint256 maxPriceWithFee,
        bytes calldata data
    ) external payable override nonReentrant{
        nexuBrightMasterNft.buyCover(contractAddress,
                                  coverAsset,
                                  sumAssured,
                                  (coverPeriod),
                                  (coverType),
                                  maxPriceWithFee,
                                  data);

    }

    function buyCoverDecode(
         uint16[] memory products,
        uint16[] memory durationInDays,
        uint256[] memory amounts,
        address currency,
        uint256 premiumAmount,
        uint256[] memory helperParameters,
        uint256[] memory securityParameters,
        uint8[] memory v,
        bytes32[] memory r,
        bytes32[] memory s
    ) external payable override nonReentrant {
            revert("Unsupported operation");
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override returns (bool) {
         return interfaceId == type(IDistributor).interfaceId || supportsInterface(interfaceId);
    }
}
